import React, { Component } from 'react';
import "./index.css";

const expiredStyle = {
  fontStyle: "italic",
  fontFamily: "Avenir",
  fontSize: "24px",
  height: "400px",
  padding: "20px",
  textAlign: "center"
};

const verticalLine = {
  color: "red"
}

class Expired extends Component {
  render() {
    return (
        <div style={expiredStyle}>
        <span style={verticalLine}>|&nbsp;</span><h5>Registration for this event has closed</h5>
        <p>Because the retreat has passed, registration and contact have been disabled for this site</p>
        <p>Sorry for the inconvenience</p>
        </div>
    )
  };
};

export default Expired;
